import React, { Component } from 'react';
import styled from 'styled-components';

const ItemBox = styled.div`
  background-color: #6D7FAB;
  border-radius: 20px;
  margin-left: 20px;
  margin-bottom: 20px;
`;

const ItemName = styled.p`
  color: white;
  text-align: center;
  margin-top: 10px;
  margin-bottom: 10px;
`;

class Item extends Component {
  render() {
    return (
      <ItemBox>
        <ItemName>Apples</ItemName>
      </ItemBox>
    );
  }
}

export default Item;
